export class User {

  password;
  repeatPassword;

  userId;

  firstname;
  lastname;

  phoneTitle;
  phoneNumber;

  role;

  email;
  username;

  birthDate;
  accountCreationDate;
  lastLoginDate;
  lastLogoutDate;

  name = {
    firstname: "",
    lastname: ""
  };

  phones = [
    {
      title: "",
      number: 0
    }
  ];

  
  constructor(userId, firstname, lastname, phoneTitle, phoneNumber, role, email, username, birthDate, accountCreationDate, lastLoginDate, lastLogoutDate) {
    this.userId = userId;
    this.firstname = firstname;
    this.lastname = lastname;
    this.phoneNumber = phoneNumber;
    this.phoneTitle = phoneTitle;
    this.role = role;
    this.email = email;
    this.username = username;
    this.birthDate = birthDate;
    this.accountCreationDate = accountCreationDate;
    this.lastLoginDate = lastLoginDate;
    this.lastLogoutDate = lastLogoutDate;
  }
}
